rary login feature\n\n  User Story:\n  As a user, I should be able to login with correct credentials to different accounts.And dashboard should be displayed.\n  Accounts are: librarian, student, admin\n\n  Background: For all scenarios user is on the login page of the library application\n    Given user is on the login page of the library application\n\n@librarian @smoke\n  Scenario: Login as librarian\n\n    When user enters librarian username\n    And user enters librarian password\n    Then user should see the dashboard\n@student @smoke\n    Scenario: Login as student\n      When user enters student username\n      And user enters student password\n      Then user should see the dashboard\n@admin\n  Scenario: Login as admin\n\n    When user enters admin username\n    And user enters admin password\n    Then user should see the dashboard","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/gleasonanastasia/IdeaProjects/cydeo-cucumber-junit-myproject/src/test/resources/features/Login.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@regression","id":"ff60f4c7-f886-4f7c-bec7-fbc644ed59e1"}],"language":"en","keyword":"Feature","name":"Library login feature","description":"  User Story:\n  As a user, I should be able to login with correct credentials to different accounts.And dashboard should be displayed.\n  Accounts are: librarian, student, admin","children":[{"background":{"location":{"line":8,"column":3},"keyword":"Background","name":"For all scenarios user is on the login page of the library application","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Given ","text":"user is on the login page of the library application","id":"41bf179e-7c1d-41e1-92e1-8ceb4bdc112c"}],"id":"7b910a9a-4dea-4949-a320-8e96d9a83a7c"}},{"scenario":{"location":{"line":12,"column":3},"tags":[{"location":{"line":11,"column":1},"name":"@librarian","id":"526556e8-2a7a-45ba-abde-67924
